import './App.css';
import React from 'react'


function Categories() {
  return (
    <React.Fragment>
        <h3>
            صفحه اصلی
        </h3>
    <div className="banner">
     
     <button className="bannerBTN">!اینجا چه خبره</button>
    </div>
    <div className="chart">
        <h3></h3>
نمودار میزان مصرف کل
    </div>
    <div className="table">
        جدول بسته های پیشنهادی
    </div>
    
  </React.Fragment>
  );
}

export default Categories;
